Дамушы елдердің көпшілігінде не мұнайдың, не көмірдің ірі қорлары жоқ, ол елдер сондықтан өндірістік-энергетикалық ресурстардың импортына тәуелді. Ал аса дамымаған елдерде отынға деген сұраныстың айтарлықтай бөлігі ағаш отын және биомассаның өзге түрлері(сабан, көк) есебінен қамтамасыз етіледі. Энергетикалык ресурстардың шектеулі монополиялы сипат алуы XX ғасырдың 70-жылдары энергетикалық ресурстардың жетіспеушілігіне, әсіресе мұнайдың, ш рілуіне, соньщ салдарыная әлемдік жүзілік экономика дамуышы қаркықлы өзін-өзі жоғалтты. Энергетикалық қорларының есімінен асып түсті, төмендей бастады. Экологиялық проблемалардың шиеленісуі де айтарлықтай деңгейге жетті. Дәл осы кезде алғашкы өлемдік ресурстардың саркылуы жөнінде қоркынышты болжамдар өмірге келді. "Ресурстық жомарттық" дәуірінен әнергияны тиімді пайдалану дәуіріне өту басталды. Минералдық ресурстар. Минералдық ресурстарға металдар, металл емес, пайдалы қазбалар, техникалык, кұрылыс материалдары жатады (10-сызба- нұсқаны жөне косымшаны қарандар).
Пайдалы казбалардың ішінде темір кені үлкен маңызға ие. Оның жер кыртысындағы қоры 600 млрд т мөлшерінде бағаланып отыр. Дамыған елдерде соңғы жылдары темір кенін өндіру қысқарған. Бұл болат балқытудың азаюына және металл сынықтарын кайта ендеуге байланысты. Сонымен қатар болатты езге материалдармен алмастыруға да болады. Темір кені дүниежүзінің көптеген аймақтарында өндіріледі (оларды картадан анықтаңдар). Марганец кенін өндіруден ТМД өзге елдерден айтарлықтай алдыңғы орында (Аустралиядан 1 млн т, Бразилиядан 990 мың т, Үндістаннан 400 мың т артық). Қазақстанның жер қойнауынан пайдалы қазбалардың көптеген түрлері табылған. Еліміз вольфрамның барланған қоры бойынша дүниежүзінде 1-орында, уран, фосфор және хромит кендерінен 2-орында, ал молибден мен қорғасыннан 4-орында. Батыс аймақтарда мұнай мен газдың мол қоры шоғырланған. Кен орындары өзге де пайдалы казбаларға бай. Алайда кеннен пайдалы өнім алу дөрежесі темен (темір 25—50%, мыс 0,3—0,6%, никель 1,3%, селен 0,1— 0,2%). Өнім өндіру барысында аса көп мөлшерде үйіндіге айналатын қалдықтар пайда болады. Сондықтан табиғат ресурстарын тиімді пайдаланудың негізгі принциптері мынадай болуға тиіс:
толық алу;
кешенді ендіру;
қайта пайдалану;
үнемді пайдалану.
